import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'
import Navbar from './Navbar'
import About from './Pages/About.js'


function App() {

  const columns = [
    {
      key: "john",
      value: "John Doe",
    },
    {
      key: "jane",
      value: "Jane Doe",
    },
    {
      key: "mary",
      value: "Mary Phillips",
    },
    {
      key: "robert",
      value: "Robert",
    },
    {
      key: "karius",
      value: "Karius",
    },
  ];

  let Component
  switch(window.location.pathname){
    case "/":
      Component = App
      break

    case "/Courses":
      Component = Courses
      break

    case "/About":
      Component = About
      break
  }

  return (

    <div className="App">
      <Navbar/>

      {/* <button className = "loginButton">Login</button> */}

      <p className="helloWorld">
        Hello World
      </p>

      <p className='searchBarContainer'>
        <ReactSearchBox
          placeholder="Search a course name"
          value="Doe"
          data={columns}
          callback={(record) => console.log(record)}
        />
      </p>

    </div>


  );
}

export default App;
